CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `sql_manconductor` AS select `conductores`.`TpIdConductor` AS `Pertipid`,`conductores`.`IdConductor` AS `Periden`,`conductores`.`Apellido1` AS `perapell1`,`conductores`.`Apellido2` AS `perapell2`,`conductores`.`Nombre` AS `pernombre`,`conductores`.`TelConductor` AS `pertelefono`,`conductores`.`Direccion` AS `perdireccion`,`ciudades`.`CodMinTrans` AS `perciudad`,`conductores`.`Categoria` AS `percateglice` from (`ciudades` join `conductores` on((`ciudades`.`IdCiudad` = `conductores`.`IdCiudad`))) ; ;

-- ----------------------------
-- View structure for sql_manmanifiesto
-- ----------------------------
DROP VIEW IF EXISTS `sql_manmanifiesto`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `sql_manmanifiesto` AS select `informacionempresa`.`Nit` AS `Nitempresa`,`despachos`.`IdManifiesto` AS `Mannumero`,`despachos`.`OrdDespacho` AS `mannumero_empresa`,`despachos`.`FhExpedicion` AS `Manfechexped`,`ciuorigen`.`CodMinTrans` AS `manciud_origen`,`ciudestino`.`CodMinTrans` AS `manciud_destin`,`despachos`.`IdVehiculo` AS `Manplaca`,`conductores`.`TpIdConductor` AS `Mantipidconduc`,`conductores`.`IdConductor` AS `Manidenconduc`,`vehiculos`.`PlacaRemolque` AS `Manplacacsemir`,`carrocerias`.`CodMinTrans` AS `Mantipocarrocer`,`vehiculos`.`VehConfiguracion` AS `Manconfiguraci`,`vehiculos`.`PesoVacio` AS `Manpeso`,`despachos`.`VrFlete` AS `Manvlrtotflete`,`despachos`.`VrDctoRteFte` AS `Manretefuente`,`despachos`.`VrDctoIndCom` AS `mandescu_ley`,`despachos`.`VrAnticipo` AS `manvlr_anticip`,`despachos`.`LugarPago` AS `manlugar_pago`,`despachos`.`FhPagoSaldo` AS `Manfechpagsal`,`despachos`.`PagoCargue` AS `manpago_cargue`,`despachos`.`PagoDescargue` AS `manpago_descar`,`despachos`.`Observaciones` AS `manobservacion`,`titular`.`TpDoc` AS `mantipidtitular`,`vehiculos`.`IdPropietario` AS `manidentitular`,`despachos`.`KilosReales` AS `manpesobv`,`despachos`.`FhCumplidos` AS `fechentrega` from (((((((`despachos` left join `informacionempresa` on((`despachos`.`IdEmpresa` = `informacionempresa`.`Id`))) join `ciudades` `ciuorigen` on((`despachos`.`IdCiudadOrigen` = `ciuorigen`.`IdCiudad`))) join `ciudades` `ciudestino` on((`despachos`.`IdCiudadDestino` = `ciudestino`.`IdCiudad`))) join `conductores` on((`despachos`.`IdConductor` = `conductores`.`IdConductor`))) join `vehiculos` on((`despachos`.`IdVehiculo` = `vehiculos`.`IdPlaca`))) join `carrocerias` on((`vehiculos`.`IdCarroceria` = `carrocerias`.`IdCarroceria`))) join `terceros` `titular` on((`vehiculos`.`IdPropietario` = `titular`.`IDTercero`))) where (`despachos`.`OrdDespacho` = 15148) ; ;

-- ----------------------------
-- View structure for sql_manremesas
-- ----------------------------
DROP VIEW IF EXISTS `sql_manremesas`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `sql_manremesas` AS select `informacionempresa`.`Nit` AS `nitempresa`,`despachos`.`IdManifiesto` AS `remnumero`,`guias`.`Unidades` AS `remcantidad`,`guias`.`KilosReales` AS `rempeso`,`guias`.`Remitente` AS `remremtente`,`guias`.`NmDestinatario` AS `remdestinatario`,`ciudestino`.`CodMinTrans` AS `remciudad_desti`,`guias`.`IdDespacho` AS `remnromanifiesto`,`guias`.`Guia` AS `remnrorempresa`,`informacionempresa`.`NroPoliza` AS `rempoliza`,`informacionempresa`.`NitAseguradora` AS `remaseguradora`,`informacionempresa`.`VencePoliza` AS `remvencimiento`,`ciuorigen`.`CodMinTrans` AS `remciudad_orig`,`guias`.`VrFlete` AS `Remvalremesa`,`guias`.`VrDeclarado` AS `Remvalproducto` from ((((`guias` left join `informacionempresa` on((`guias`.`IdEmpresa` = `informacionempresa`.`Id`))) join `ciudades` `ciudestino` on((`guias`.`IdCiuDestino` = `ciudestino`.`IdCiudad`))) join `ciudades` `ciuorigen` on((`guias`.`IdCiuOrigen` = `ciuorigen`.`IdCiudad`))) join `despachos` on((`guias`.`IdDespacho` = `despachos`.`OrdDespacho`))) where (`guias`.`IdDespacho` = 14018) ; ;

-- ----------------------------
