-- ----------------------------
-- View structure for sql_manvehiculo
-- ----------------------------
DROP VIEW IF EXISTS `sql_manvehiculo`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `sql_manvehiculo` AS select `vehiculos`.`IdPlaca` AS `vehplaca`,`marcas`.`CodMinTrans` AS `vehmarca`,`lineas`.`NmLinea` AS `vehlinea`,`vehiculos`.`Modelo` AS `vehmodelo`,`vehiculos`.`ModeloRep` AS `vehmodelotransf`,`vehiculos`.`Serie` AS `vehnroserie`,`colores`.`CodMinTrans` AS `vehcolor`,`carrocerias`.`CodMinTrans` AS `vehtipocarrocer`,`vehiculos`.`VehConfiguracion` AS `vehconfiguraci`,`vehiculos`.`PesoVacio` AS `vehpeso`,`vehiculos`.`RegNalCarga` AS `vehregistro`,`vehiculos`.`Soat` AS `vehnro_poliza`,`aseguradora`.`TpDoc` AS `vehtipidasegur`,`aseguradora`.`IDTercero` AS `vehidenasegur`,`vehiculos`.`VenceSoat` AS `vehfechvenci`,`vehiculos`.`PlacaRemolque` AS `vehplacsemir`,`propietario`.`TpDoc` AS `vehtipidpropiet`,`propietario`.`IDTercero` AS `vehidentprop`,`tenedor`.`TpDoc` AS `Vehtipidtenenc`,`tenedor`.`IDTercero` AS `Vehidentenenc` from (((((((`vehiculos` left join `marcas` on((`vehiculos`.`IdMarca` = `marcas`.`IdMarca`))) left join `lineas` on((`vehiculos`.`IdLinea` = `lineas`.`IdLinea`))) left join `colores` on((`vehiculos`.`IdColor` = `colores`.`IdColor`))) left join `carrocerias` on((`vehiculos`.`IdCarroceria` = `carrocerias`.`IdCarroceria`))) left join `terceros` `aseguradora` on((`vehiculos`.`IdAseguradora` = `aseguradora`.`IDTercero`))) left join `terceros` `propietario` on((`vehiculos`.`IdPropietario` = `propietario`.`IDTercero`))) left join `terceros` `tenedor` on((`vehiculos`.`IdTenedor` = `tenedor`.`IDTercero`))) ; ;

-- ----------------------------
-- Procedure structure for spAseguradora
-- ----------------------------
DROP PROCEDURE IF EXISTS `spAseguradora`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `spAseguradora`(IN FhInicio DATE)
BEGIN
  select
    `despachos`.`IdVehiculo` AS `IdVehiculo`,
    count(`despachos`.`OrdDespacho`) AS `CuentaDeOrdDespacho`,
    `vehiculos`.`Modelo` AS `Modelo`,
    `vehiculos`.`Serie` AS `Serie`,
    concat(`propietario`.`Nombre`,
    _latin1' ',`propietario`.`Apellido1`,_latin1' ',`propietario`.`Apellido2`) AS `NmPropietario`,concat(`tenedor`.`Nombre`,_latin1' ',`tenedor`.`Apellido1`,_latin1' ',`tenedor`.`Apellido2`) AS `NmTenedor`,sum(`despachos`.`Unidades`) AS `TUnidades`,sum(`despachos`.`KilosReales`) AS `TKilosReales`,sum(`despachos`.`Remesas`) AS `TRemesas` from (((`despachos` left join `vehiculos` on((`despachos`.`IdVehiculo` = `vehiculos`.`IdPlaca`))) left join `terceros` `propietario` on((`vehiculos`.`IdPropietario` = `propietario`.`IDTercero`))) left join `terceros` `tenedor` on((`vehiculos`.`IdTenedor` = `tenedor`.`IDTercero`))) where (`despachos`.`FhExpedicion` >= _latin1'2010-06-01')
  group by
    `despachos`.`IdVehiculo`,
    `vehiculos`.`Modelo`,
    `vehiculos`.`Serie`;
END
;;
DELIMITER ;

