-- ----------------------------
-- Procedure structure for spGuardarUsuarios
-- ----------------------------
DROP PROCEDURE IF EXISTS `spGuardarUsuarios`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `spGuardarUsuarios`(IN Usuario VARCHAR(20), IN seleccionCheck INTEGER(2), OUT iResultado INTEGER(11), IN opSP INTEGER(2))
BEGIN

DECLARE iCuenta INT;

IF opSP = 0 THEN
VALUES(Usuario,seleccionCheck);
ELSE
UPDATE `usuariospermisos` SET `Permiso`=seleccionCheck
WHERE `usuariospermisos`.`Usuario` = Usuario;
END IF;
SET @iResultado=1;
/*SELECT COUNT(*) INTO iCuenta FROM `usuariospermisos`

WHERE `usuariospermisos`.`IdUsuario`=Usuario;

IF iCuenta>0 THEN

 SET @iResultado=1;

END IF;*/


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for spKLEmpresas
-- ----------------------------
DROP PROCEDURE IF EXISTS `spKLEmpresas`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `spKLEmpresas`(
        IN IdTercero DOUBLE
    )
BEGIN
  select
    `terceros`.`TpDoc` AS `emptipid`,
    `terceros`.`IDTercero` AS `empident`, 
   `terceros`.`RazonSocial` AS `empnombr`,
